import { NavLink } from "react-router-dom";
import { FaHome, FaShoppingBag, FaInfoCircle, fa } from 'react-icons/fa';
import '../css/Navbar.css'

import myImg from '../img/myImg.jpg'

const navItem = [
  {
    pathName: "Dashboard",
    path: "/",
    icon: <FaHome />
  },
  {
    pathName: "Products",
    path: "/products",
    icon: <FaShoppingBag />
  },
  {
    pathName: "About us",
    path: "/about",
    icon: <FaInfoCircle />
  },
];

const Navbar = () => {
  const navList = navItem.map((item) => (
    <li key={item.path}>
      <NavLink to={item.path}>
        {item.icon} {item.pathName}
      </NavLink>
    </li>
  ));

  return (
    <nav>
      <section className="shopOwnerInfo">
        <img src={myImg} alt="owner" />
        <div>
          <p>Shop Owner</p>
          <h4>Łukasz Rydwański</h4>
        </div>
        <button><faArrowLeft /></button>
      </section>
      <hr/>
      <ul>
        {navList}
      </ul>
    </nav>
  );
};

export default Navbar;
